import React from 'react';
import ReactDOM from 'react-dom';
import Data from './Data';

function App({text}) {
  return(
  <div>
    <Data />
  </div>
  );
}

ReactDOM.render(
  <React.StrictMode>
    <App/>
  </React.StrictMode>,
  document.getElementById('root')
);
